import React, { useState } from 'react';
import Timer from './Timer';
import BTSYoutube from './Youtube/BTSYoutube.js';
import KirbyYoutube from './Youtube/KirbyYoutube';
import './App.css';

function App() {

  const [bts, setBts] = useState(false)
  return (
    <div className="App">
    <div className="Timer">
      <Timer/>
      </div>

      <div className="YoutubeButton">
        <button
        className="BTSBtn"
        onClick={setBts(true)}>
        BTS
        </button>

        <button
        className="KirbyBtn"
        onClick={<KirbyYoutube/>}>
        Kirby
        </button>
      </div>

      if (bts) {
        <BTSYoutube/>
      }
    </div>
  )
}

export default App;
